import React from 'react';

interface IProps{
    id:string,
    name:string,
    value:string,
    type:string
}

function OptionList({
    id,
    name,
    value,
    type
  }:IProps) {
  return (
    <div>
        <input type={type} id={id} name={name} value={value}/>
        <label htmlFor={id}>{value}</label>
    </div>
  )
}

export default OptionList;
